import React from 'react';
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Login from "./login";

class Root extends React.Component{
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div>
                <BrowserRouter>
                    <Switch>
                        <Route>Path="/" exc</Route>
                        <Route Path="/login" component={Login}/>
                    </Switch>
                </BrowserRouter>
            </div>
        )
    }
}

export default Root;
